   "source": [
    "# Title: Data Preparation\n",
    "# Description: The goal of this script is to create a csv data file that will contain all the required variables used in the data visualization phase.\n",
    "# Inputs: The five data CSV files (one for each player) and the stacked csv file.\n",
    "# Outputs: The summaries of each of the five data csv files and the stacked csv file.\n",
    "library(stringr)\n",
    "library(dplyr)\n",
    "col_types = c(\"character\", \"character\", \"integer\", \"integer\", \"integer\", \"integer\", \"factor\",\"character\",\"factor\",\"integer\",\"character\", \"integer\", \"integer\")\n",
    "curry <- read.csv(\"../data/stephen-curry.csv\", stringsAsFactors = F, colClasses = col_types)\n",
    "iguodala <- read.csv(\"../data/andre-iguodala.csv\", stringsAsFactors = F, colClasses = col_types)\n",
    "green <- read.csv(\"../data/draymond-green.csv\", stringsAsFactors = F, colClasses = col_types)\n",
    "durant <- read.csv(\"../data/kevin-durant.csv\", stringsAsFactors = F, colClasses = col_types)\n",
    "thompson <- read.csv(\"../data/klay-thompson.csv\", stringsAsFactors = F, colClasses = col_types)\n",
    "\n",
    "names(curry)\n",
    "names(iguodala)\n",
    "names(green)\n",
    "names(durant)\n",
    "names(thompson)\n",
    "\n",
    "\n",
    "\n",
    "curry <- mutate(curry, Player = \"Stephen\")\n",
    "durant <- mutate(durant,Player  = \"Kevin\")\n",
    "thompson <- mutate(thompson, Player = \"Klay\")\n",
    "green <- mutate(green, Player = \"Draymond\")\n",
    "iguodala <- mutate(iguodala, Player = \"Andre\")\n",
    "\n",
    "curry$Shot <- str_replace(curry$Shot, \"n\", \"No\")\n",
    "curry$Shot <- str_replace(curry$Shot, \"y\", \"Yes\")\n",
    "iguodala$Shot <- str_replace(iguodala$Shot, \"n\", \"No\")\n",
    "iguodala$Shot <- str_replace(iguodala$Shot, \"y\", \"Yes\")\n",
    "green$Shot <- str_replace(green$Shot, \"n\", \"No\")\n",
    "green$Shot <- str_replace(green$Shot, \"y\", \"Yes\")\n",
    "durant$Shot <- str_replace(durant$Shot, \"n\", \"No\")\n",
    "durant$Shot <- str_replace(durant$Shot, \"y\", \"Yes\")\n",
    "thompson$Shot <- str_replace(thompson$Shot, \"n\", \"No\")\n",
    "thompson$Shot <- str_replace(thompson$Shot, \"y\", \"Yes\")\n",
    "\n",
    "\n",
    "\n",
    "# curry <- mutate(curry, minute = (period - 1)*12 + 12 - minutes_remaining)\n",
    "# iguodala <- mutate(iguodala, minute = (period - 1)*12 + 12 - minutes_remaining)\n",
    "# green <- mutate(green, minute = (period - 1)*12 + 12 - minutes_remaining)\n",
    "# durant <- mutate(durant, minute = (period - 1)*12 + 12 - minutes_remaining)\n",
    "# thompson <- mutate(thompson, minute = (period - 1)*12 + 12 - minutes_remaining)\n",
    "\n",
    "sink(file = \"../output/stephen-curry-summary.txt\")\n",
    "summary(curry)\n",
    "sink()\n",
    "sink(file = \"../output/andre-iguodala-summary.txt\")\n",
    "summary(iguodala)\n",
    "sink()\n",
    "sink(file = \"../output/graymond-green-summary.txt\")\n",
    "summary(green)\n",
    "sink()\n",
    "sink(file = \"../output/kevin-durant-summary.txt\")\n",
    "summary(durant)\n",
    "sink()\n",
    "sink(file = \"../output/klay-thompson-summary.txt\")\n",
    "summary(thompson)\n",
    "sink()\n",
    "\n",
    "stacked <- rbind(curry, durant, thompson, green, iguodala)\n",
    "write.csv(stacked, file = \"../data/shots-data.csv\")\n",
    "sink(file = \"../output/shots-data-summary.txt\")\n",
    "summary(stacked)\n",
    "sink()\n"
   ]
