   "source": [
    "# Title: Shot Charts\n",
    "# Description: In this file we will be creating shot charts.\n",
    "# Inputs: nba-court.jpg, the 6 dataframes created in the make-shots-data.\n",
    "# Outputs: pdf files of all the players shot charts and then a pdf file of all players combined, and a png file of all players combined.\n",
    "\n",
    "install.packages(\"jpeg\")\n",
    "library(\"grid\")\n",
    "library(\"jpeg\")\n",
    "library(ggplot2)\n",
    "court_file <- \"../images/nba-court.jpg\"\n",
    "court_image <- rasterGrob(\n",
    "  readJPEG(court_file),\n",
    "  width = unit(1, \"npc\"),\n",
    "  height = unit(1, \"npc\")\n",
    ")\n",
    "\n",
    "# curry_shot_chart <- ggplot(data = curry) + \n",
    "#   annotation_custom(court_image, -250, 250, -50, 420) +\n",
    "#   geom_point(aes(x = x, y = y, color = Shot)) +\n",
    "#   ylim(-50,420) +\n",
    "#   ggtitle(\"Stephen Curry Shot Chart (2016 Season)\") +\n",
    "#   theme_minimal()\n",
    "\n",
    "# durant_shot_chart <- ggplot(data = durant) + \n",
    "#   annotation_custom(court_image, -250, 250, -50, 420) +\n",
    "#   geom_point(aes(x = x, y = y, color = Shot)) +\n",
    "#   ylim(-50,420) +\n",
    "#   ggtitle(\"Shot Chart: Kevin Durant (2016 Season)\") +\n",
    "#   theme_minimal()\n",
    "\n",
    "# thompson_shot_chart <- ggplot(data = thompson) + \n",
    "#   annotation_custom(court_image, -250, 250, -50, 420) +\n",
    "#   geom_point(aes(x = x, y = y, color = Shot)) +\n",
    "#   ylim(-50,420) +\n",
    "#   ggtitle(\"Shot Chart: Klay Thompson (2016 Season)\") +\n",
    "#   theme_minimal()\n",
    "\n",
    "# green_shot_chart <- ggplot(data = green) + \n",
    "#   annotation_custom(court_image, -250, 250, -50, 420) +\n",
    "#   geom_point(aes(x = x, y = y, color = Shot)) +\n",
    "#   ylim(-50,420) +\n",
    "#   ggtitle(\"Shot Chart: Draymond Green (2016 Season)\") +\n",
    "#   theme_minimal()\n",
    "\n",
    "# iguodala_shot_chart <- ggplot(data = iguodala) + \n",
    "#   annotation_custom(court_image, -250, 250, -50, 420) +\n",
    "#   geom_point(aes(x = x, y = y, color = Shot)) +\n",
    "#   ylim(-50,420) +\n",
    "#   ggtitle(\"Shot Chart: Andre Iguodala (2016 Season)\") +\n",
    "#   theme_minimal()\n",
    "\n",
    "\n",
    "# pdf(file = \"../images/stephen-curry-shot-chart.pdf\", width = 6.5, height = 5)\n",
    "# curry_shot_chart\n",
    "# dev.off()\n",
    "# pdf(file = \"../images/andre-iguodala-shot-chart.pdf\", width = 6.5, height = 5)\n",
    "# iguodala_shot_chart\n",
    "# dev.off()\n",
    "# pdf(file = \"../images/graymond-green-shot-chart.pdf\", width = 6.5, height = 5)\n",
    "# green_shot_chart\n",
    "# dev.off()\n",
    "# pdf(file = \"../images/kevin-durant-shot-chart.pdf\", width = 6.5, height = 5)\n",
    "# durant_shot_chart\n",
    "# dev.off()\n",
    "# pdf(file = \"../images/klay-thompson-shot-chart.pdf\", width = 6.5, height = 5)\n",
    "# thompson_shot_chart\n",
    "# dev.off()\n",
    "\n",
    "facetted <- ggplot(data = stacked) + \n",
    "  annotation_custom(court_image, -250, 250, -50, 420) +\n",
    "  geom_point(aes(x = x, y = y, color = Shot)) +\n",
    "  ylim(-50,420) +\n",
    "  ggtitle(\"2016 Season Golden State Warriors Players' Shot Charts\") +\n",
    "  labs(caption = \"Visualization by: Vishal Sunkara\\nSource: stats.nba.com\") +\n",
    "  theme_minimal() + facet_wrap(Player ~.)\n",
    "facetted\n",
    "ggsave(\"../images/gsw-shot-charts.pdf\", facetted, width = 8, height = 7)\n",
    "ggsave(\"../images/gsw-shot-charts.png\", facetted, width = 8, height = 7)"
   ]
