   "source": [
    "shots <- read.csv(\"../data/shots-data.csv\", stringsAsFactors = F)\n",
    "# head(shots) \n",
    "\n",
    "shot_two <- select(filter(shots, shot_type == \"2PT Field Goal\"), Player, Shot)\n",
    "points_two = shot_two %>%\n",
    "  group_by(Player) %>%\n",
    "  summarise(Total = n(), Shots_Made = sum(Shot == \"Yes\")) \n",
    "points_two <- arrange(mutate(points_two, Shots_Made_Percentage = round((Shots_Made/Total)*100)), desc(Shots_Made_Percentage))\n",
    "points_two <- as.data.frame(points_two)\n",
    "\n",
    "\n",
    "shot_three <- select(filter(shots, shot_type == \"3PT Field Goal\"), Player, Shot)\n",
    "points_three = shot_three %>%\n",
    "  group_by(Player) %>%\n",
    "  summarise(Total = n(), Shots_Made = sum(Shot == \"Yes\")) \n",
    "points_three <- arrange(mutate(points_three, Shots_Made_Percentage = round((Shots_Made/Total)*100)), desc(Shots_Made_Percentage))\n",
    "points_three <- as.data.frame(points_three)\n",
    "\n",
    "\n",
    "all <- select(shots, Player, Shot)\n",
    "points_all = all %>%\n",
    "  group_by(Player) %>%\n",
    "  summarise(Total = n(), Shots_Made = sum(Shot == \"Yes\")) \n",
    "points_all <- arrange(mutate(points_all, Shots_Made_Percentage = round((Shots_Made/Total)*100)), desc(Shots_Made_Percentage))\n",
    "points_all <- as.data.frame(points_all)\n",
    "\n",
    "\n",
    "points_two\n",
    "points_three\n",
    "points_all\n",
    "\n",
    "\n",
    "a <- prop.test(points_two$Shots_Made, points_two$Total, p = NULL, alternative = \"two.sided\", correct = TRUE)\n",
    "b <- prop.test(points_three$Shots_Made, points_three$Total, p = NULL, alternative = \"two.sided\", correct = TRUE)\n",
    "c <- prop.test(points_all$Shots_Made, points_all$Total, p = NULL, alternative = \"two.sided\", correct = TRUE)\n",
    "\n",
    "# a\n",
    "# b\n",
    "# c"
   ]
